import { Link } from "react-router-dom";
import React from "react";

const Attraction = (props) => {
    const attraction = props.attraction;
    return(
        <Link to={"/attractions/" + attraction.id}>
            <li>{attraction.name}</li>
        </Link>);
}
export default Attraction
